Create internal/provider/vm.go: package provider import ( "encoding/json" "fmt" "io/ioutil" "os" "path/filepath" "time" "github.com/projectbeskar/virtrigaud/proto/rpc/provider/v1"
) type VirtualMachine struct { ID string `json:"id"` Name string `json:"name"` Spec *providerv1.VMSpec `json:"spec"` Status *providerv1.VMStatus `json:"status"` CreatedAt time.Time `json:"created_at"` UpdatedAt time.Time `json:"updated_at"`
} type FileStore struct { baseDir string
} func NewFileStore(baseDir string) *FileStore { return &FileStore{baseDir: baseDir}
} func (fs *FileStore) Save(vm *VirtualMachine) error { if err := os.MkdirAll(fs.baseDir, 0755); err != nil { return fmt.Errorf("failed to create directory: %w", err) } vm.UpdatedAt = time.Now() data, err := json.MarshalIndent(vm, "", " ") if err != nil { return fmt.Errorf("failed to marshal VM: %w", err) } filename := filepath.Join(fs.baseDir, vm.ID+".json") return ioutil.WriteFile(filename, data, 0644)
} func (fs *FileStore) Load(id string) (*VirtualMachine, error) { filename := filepath.Join(fs.baseDir, id+".json") data, err := ioutil.ReadFile(filename) if err != nil { if os.IsNotExist(err) { return nil, fmt.Errorf("VM not found: %s", id) } return nil, fmt.Errorf("failed to read VM file: %w", err) } var vm VirtualMachine if err := json.Unmarshal(data, &vm); err != nil { return nil, fmt.Errorf("failed to unmarshal VM: %w", err) } return &vm, nil
} func (fs *FileStore) Delete(id string) error { filename := filepath.Join(fs.baseDir, id+".json") if err := os.Remove(filename); err != nil && !os.IsNotExist(err) { return fmt.Errorf("failed to delete VM file: %w", err) } return nil
} func (fs *FileStore) List() ([]*VirtualMachine, error) { files, err := ioutil.ReadDir(fs.baseDir) if err != nil { if os.IsNotExist(err) { return []*VirtualMachine{}, nil } return nil, fmt.Errorf("failed to read directory: %w", err) } var vms []*VirtualMachine for _, file := range files { if !file.IsDir() && filepath.Ext(file.Name()) == ".json" { id := file.Name()[:len(file.Name())-5] // Remove .json extension vm, err := fs.Load(id) if err != nil { continue // Skip invalid files } vms = append(vms, vm) } } return vms, nil
}

