} func (ai *AuthInterceptor) Unary() grpc.UnaryServerInterceptor { return func(ctx context.Context, req interface{}, info *grpc.UnaryServerInfo, handler grpc.UnaryHandler) (interface{}, error) { // Skip authentication for health checks if strings.HasSuffix(info.FullMethod, "/Health/Check") { return handler(ctx, req) } token, err := ai.extractToken(ctx) if err != nil { return nil, status.Errorf(codes.Unauthenticated, "missing or invalid token: %v", err) } claims, err := ai.tokenService.ValidateToken(token) if err != nil { return nil, status.Errorf(codes.Unauthenticated, "invalid token: %v", err) } // Check authorization if !ai.rbac.IsAuthorized(claims, info.FullMethod) { return nil, status.Errorf(codes.PermissionDenied, "insufficient permissions") } // Add claims to context ctx = context.WithValue(ctx, "claims", claims) return handler(ctx, req) }
} func (ai *AuthInterceptor) extractToken(ctx context.Context) (string, error) { md, ok := metadata.FromIncomingContext(ctx) if !ok { return "", fmt.Errorf("missing metadata") } authHeaders := md.Get("authorization") if len(authHeaders) == 0 { return "", fmt.Errorf("missing authorization header") } authHeader := authHeaders[0] if !strings.HasPrefix(authHeader, "Bearer ") { return "", fmt.Errorf("invalid authorization header format") } return strings.TrimPrefix(authHeader, "Bearer "), nil
