) type TokenManager struct { tokenService *TokenService currentToken string expiresAt time.Time mutex sync.RWMutex subject string tenant string provider string scopes []string
} func NewTokenManager(tokenService *TokenService, subject, tenant, provider string, scopes []string) *TokenManager { return &TokenManager{ tokenService: tokenService, subject: subject, tenant: tenant, provider: provider, scopes: scopes, }
} func (tm *TokenManager) GetToken() (string, error) { tm.mutex.RLock() if tm.currentToken != "" && time.Now().Before(tm.expiresAt.Add(-5*time.Minute)) { token := tm.currentToken tm.mutex.RUnlock() return token, nil } tm.mutex.RUnlock() return tm.refreshToken()
} func (tm *TokenManager) refreshToken() (string, error) { tm.mutex.Lock() defer tm.mutex.Unlock() // Double-check after acquiring write lock if tm.currentToken != "" && time.Now().Before(tm.expiresAt.Add(-5*time.Minute)) { return tm.currentToken, nil } token, err := tm.tokenService.GenerateToken(tm.subject, tm.tenant, tm.provider, tm.scopes, time.Hour) if err != nil { return "", err } tm.currentToken = token tm.expiresAt = time.Now().Add(time.Hour) return token, nil
